import React from 'react';
import Category from './Category.jsx';
import './Categories.css';

function Categories({title}) {
    return (
        <div className="categories">
            <h2 className="title">{title}</h2>
            <ul>
                <Category src={require('./send.png')} name="Отправленные"></Category>
                <Category src={require('./get.png')} name="Входящие"></Category>
                <Category name="Полученные"></Category>
                <Category name="Рассылки"></Category>
                <Category name="Архив"></Category>
                <Category name="Корзина"></Category>
            </ul>
        </div>
    )
}

export default Categories;
